	/**
	 * 设置数组保存每个元素对应的值的列表
	 * @param s
	 * @param t
	 * @return
	 */
	public static boolean isIsomorphic(String s, String t) {
		int[] m1 = new int[256];
		int[] m2 = new int[256]; // 两个数组
		int n = s.length();
		for (int i = 0; i < n; ++i) { // 遍历两个字符串的每一个元素
			if (m1[s.charAt(i)] != m2[t.charAt(i)]) return false;   // 每个字符串对应在数组中的值是否一致，如果不一致则返回
			m1[s.charAt(i)] = i + 1;
			m2[t.charAt(i)] = i + 1;
			System.out.println(s.charAt(i) + "," + m1[s.charAt(i)]);
			System.out.println(t.charAt(i) + "," + m2[t.charAt(i)]);
		}
		return true;
	}
	
